css:
.nuclide-console {
  display: flex;
  flex-direction: column;
  width: 100%;
}
.nuclide-ui-toolbar {
  background-color: #282c34;
}
atom-panel .nuclide-ui-toolbar {
  background-color: #21252b;
}
.nuclide-console-body {
  display: flex;
  flex: 1;
  flex-direction: column;
  background-color: #282c34;
  min-height: 0;
}
.nuclide-console-lazy-nested-value div,
.nuclide-console-lazy-nested-value span {
  font-size: 10.8px;
  font-family: Menlo, Monaco, Consolas, "Courier New", monospace;
  white-space: pre-wrap;
  word-break: normal;
  word-wrap: break-word;
}
.nuclide-console-lazy-nested-value {
  display: flex;
}
.nuclide-console-lazy-nested-value .list-item::before div {
  display: flex;
}
.nuclide-console-lazy-nested-value .list-tree li:not(.list-nested-item) {
  line-height: 1.6em;
}
.nuclide-console-lazy-nested-value div.list-item > div {
  display: inline-block;
}
.nuclide-console-scroll-pane {
  overflow-y: auto;
  overflow-x: hidden;
  background-color: #282c34;
  transform: translate3d(0, 0, 0);
}
.nuclide-console-table-wrapper {
  -webkit-user-select: text;
}
.nuclide-console-record {
  display: flex;
  padding: 1px 5px;
  background-color: #282c34;
  border-radius: 0;
  border-top: 1px solid #181a1f;
  color: #abb2bf;
}
.nuclide-console-record pre {
  background-color: transparent;
  color: #abb2bf;
  word-break: normal;
  white-space: pre-wrap;
}
.nuclide-console-record .icon {
  color: rgba(171, 178, 191, 0.3);
  text-align: center;
}
.nuclide-console-record,
.nuclide-console-record pre,
.nuclide-console-record atom-text-editor,
.nuclide-console-record .icon,
.nuclide-console-record .icon::before {
  font-size: 10.8px;
}
.nuclide-console-record .icon::before {
  width: 10.8px;
  margin-right: 0.5em;
}
.nuclide-console-record:first-child {
  border-top: none;
}
.nuclide-console-record:last-child {
  border-bottom: 1px solid #181a1f;
}
.nuclide-console-record.level-info .icon {
  color: #6494ed;
}
.nuclide-console-record.level-warning {
  background-color: #f3bf44;
  border-color: #ad7c0b;
}
.nuclide-console-record.level-warning + :not(.level-error) {
  border-top-color: #ad7c0b;
}
.nuclide-console-record.level-warning pre,
.nuclide-console-record.level-warning .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-warning .nuclide-console-lazy-nested-value span {
  color: #835b21;
}
.nuclide-console-record.level-warning .icon {
  color: #ad7c0b;
}
.nuclide-console-record.level-success {
  background-color: #72da87;
  border-color: #2ba143;
}
.nuclide-console-record.level-success + :not(.level-error):not(.level-warning) {
  border-top-color: #2ba143;
}
.nuclide-console-record.level-success pre,
.nuclide-console-record.level-success .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-success .nuclide-console-lazy-nested-value span {
  color: #1f5130;
}
.nuclide-console-record.level-success .icon {
  color: #2ba143;
}
.nuclide-console-record.level-error {
  background-color: #e89d96;
  border-color: #d13b2e;
}
.nuclide-console-record.level-error + .nuclide-console-record {
  border-top-color: #d13b2e;
}
.nuclide-console-record.level-error pre,
.nuclide-console-record.level-error .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-error .nuclide-console-lazy-nested-value span {
  color: #7a1200;
}
.nuclide-console-record.level-error .icon {
  color: #d13b2e;
}
.nuclide-console-record.level-red {
  background-color: #e89d96;
}
.nuclide-console-record.level-red pre,
.nuclide-console-record.level-red .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-red .nuclide-console-lazy-nested-value span {
  color: #7a1200;
}
.nuclide-console-record.level-orange {
  background-color: #e6c299;
}
.nuclide-console-record.level-orange pre,
.nuclide-console-record.level-orange .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-orange .nuclide-console-lazy-nested-value span {
  color: #291b0a;
}
.nuclide-console-record.level-yellow {
  background-color: #f9f5cd;
}
.nuclide-console-record.level-yellow pre,
.nuclide-console-record.level-yellow .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-yellow .nuclide-console-lazy-nested-value span {
  color: #3f3a08;
}
.nuclide-console-record.level-green {
  background-color: #70e6be;
}
.nuclide-console-record.level-green pre,
.nuclide-console-record.level-green .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-green .nuclide-console-lazy-nested-value span {
  color: #020906;
}
.nuclide-console-record.level-blue {
  background-color: #80c3ff;
}
.nuclide-console-record.level-blue pre,
.nuclide-console-record.level-blue .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-blue .nuclide-console-lazy-nested-value span {
  color: #001b33;
}
.nuclide-console-record.level-purple {
  background-color: #ec9cd9;
}
.nuclide-console-record.level-purple pre,
.nuclide-console-record.level-purple .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-purple .nuclide-console-lazy-nested-value span {
  color: #330a29;
}
.nuclide-console-record.level-violet {
  background-color: #f4c7ea;
}
.nuclide-console-record.level-violet pre,
.nuclide-console-record.level-violet .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-violet .nuclide-ui-lazy-nested-value span {
  color: #5e124c;
}
.nuclide-console-record.level-rainbow {
  background: #fff;
  background-image: linear-gradient(to right, rgba(255, 0, 0, 0.4) 0%, rgba(255, 165, 0, 0.4) 20%, rgba(255, 255, 0, 0.4) 40%, rgba(173, 255, 47, 0.4) 60%, rgba(0, 191, 255, 0.4) 80%, rgba(138, 43, 226, 0.4) 100%);
}
.nuclide-console-record.level-rainbow pre,
.nuclide-console-record.level-rainbow .nuclide-console-lazy-nested-value div,
.nuclide-console-record.level-rainbow .nuclide-ui-lazy-nested-value span,
.nuclide-console-record.level-rainbow .list-group li:not(.list-nested-item),
.nuclide-console-record.level-rainbow .list-tree li:not(.list-nested-item),
.nuclide-console-record.level-rainbow .list-group li.list-nested-item > .list-item,
.nuclide-console-record.level-rainbow .list-tree li.list-nested-item > .list-item {
  color: #000000;
}
.nuclide-console-record pre {
  display: inline;
  padding: 0;
  background-color: transparent;
}
.nuclide-console-record.request {
  display: flex;
  background-color: #282c34;
}
.nuclide-console-record-content-wrapper {
  display: flex;
  width: 100%;
  padding-top: 1px;
  padding-bottom: 1px;
}
.nuclide-console-record-content-wrapper .nuclide-ui-lazy-nested-value-treelist li.list-nested-item > .list-item,
.nuclide-console-record-content-wrapper .nuclide-ui-lazy-nested-value-treelist .list-item {
  line-height: inherit;
}
.nuclide-console-record-source-label {
  align-self: flex-start;
  margin: 2px 0 0 4px;
  white-space: nowrap;
  font-size: 0.8em;
}
span.nuclide-console-record-source-label {
  padding-top: 0;
  padding-bottom: 0;
}
.nuclide-console-input-wrapper {
  display: flex;
  background-color: #282c34;
  padding: 1px 0;
  flex-grow: 1;
}
.nuclide-console-input-wrapper atom-text-editor {
  font-size: 10.8px;
}
.nuclide-console-prompt {
  display: flex;
  padding: 5px 5px;
  border-top: 1px solid #181a1f;
  background-color: #282c34;
  color: #abb2bf;
  min-height: 30px;
  margin-top: auto;
}
.nuclide-console-prompt-wrapper {
  display: flex;
  align-items: center;
  white-space: nowrap;
}
.nuclide-console-prompt-label {
  text-transform: uppercase;
  font-weight: bold;
  font-size: 0.8em;
  padding-right: 1em;
}
.nuclide-console-scroll-pane-wrapper {
  position: relative;
  display: flex;
  flex-direction: column;
  overflow: hidden;
}
.nuclide-console-new-messages-notification {
  position: absolute;
  bottom: 0;
  left: 50%;
  text-align: center;
  padding-left: 10px;
  padding-right: 10px;
  cursor: pointer;
  transition: all 0.3s cubic-bezier(0.175, 0.885, 0.32, 1.275);
}
.nuclide-console-new-messages-notification.visible {
  margin-bottom: 5px;
  transform: translateX(-50%) translateY(0);
}
.nuclide-console-new-messages-notification:not(.visible) {
  margin-bottom: 0;
  transform: translateX(-50%) translateY(100%);
}
.nuclide-console-new-messages-notification-icon {
  display: inline-block;
  vertical-align: middle;
  text-align: left;
}
.nuclide-console-new-messages-notification-icon::before {
  width: auto !important;
}
atom-text-editor[mini].nuclide-console-filter-field {
  float: left;
  border-bottom-right-radius: 0;
  border-top-right-radius: 0;
}
atom-text-editor[mini].nuclide-console-filter-field.is-focused {
  z-index: 1;
}
atom-text-editor[mini].nuclide-console-filter-field.invalid {
  background-color: #e89d96;
  color: #7a1200;
  border-color: #d13b2e;
}
.btn.nuclide-console-filter-regexp-button {
  position: relative;
  left: -1px;
  font-weight: bold;
  font-family: Menlo, monospace;
}
.nuclide-console-header-icon-fill {
  fill: #9da5b4;
}
.nuclide-console-header-filter-icon {
  display: flex;
}
.nuclide-console-header-funnel-icon {
  height: 12px;
}
